In an age long past, the rift was formed, decisively separating the lands of light and the plains of darkness by an impassable chasm.

Over time the Enclave of light grew strong and prosperous, while those confined to war-ravaged plains of the outlands harbored nothing but hatred and jealousy. Now, after hundreds of years, the rift is closing, and it is only a matter of time before a full-scale war erupts?Enter the fantasy universe of Enclave where the eternal struggle between good and evil rages, and your actions will determine the fate of a nation.

